// src/components/Cars.jsx
import React from 'react';
import CarCard from './CarCard';
import { useCarContext } from '../contexts/CarContext'; // Використовуйте кастомний хук

const Cars = () => {
    const { cars } = useCarContext(); // Отримайте автомобілі з контексту

    return (
        <div className="cars">
            <h2>Список автомобілів</h2>
            <div className="car-list">
                {cars.map((car) => (
                    <CarCard key={car.id} car={car} />
                ))}
            </div>
        </div>
    );
};

export default Cars;
